//https://www.hackerrank.com/challenges/special-palindrome-again/problem

using System;
using System.Collections;
using System.Collections.Generic;

namespace Algorithms
{
    class Program
    {

        public class Node{
            public Node Prev{get;set;}

            public Node Next{get;set;}

            public char Text{get;set;}

            public long Count{get;set;}
        }

        static long substrCount(int n, string s)
        {
            var node = new Node(){
                Text = s[0], 
                Count = 1
            };

            var root = node;

            for(var i = 1; i < s.Length; i++){
                var c = s[i];

                if(c == node.Text){
                    node.Count++;
                }
                else{
                    var newNode = new Node(){
                        Prev = node, Count = 1, Text = c
                    };

                    node.Next = newNode;
                    node = newNode;
                }
            }

            long total = 0;

            var currentNode = root;

            while(currentNode != null){
                total += (1 + currentNode.Count) * currentNode.Count / 2; //Same

                //middle one is different 
                if(currentNode.Prev != null && currentNode.Next != null && currentNode.Count == 1){
                    if(currentNode.Prev.Text == currentNode.Next.Text){
                        var count = Math.Min(currentNode.Prev.Count, currentNode.Next.Count);
                        total += count;//(1 + count) * count / 2;
                    }
                }

                currentNode = currentNode.Next;
            }

            return total;
        }

        static void Main(string[] args)
        {
            long r = 0;
            r = substrCount(4, "aaaa");
            Console.WriteLine(r);

            r = substrCount(7, "abcbaba");
            Console.WriteLine(r);

            r = substrCount(5, "asasd");
            Console.WriteLine(r);

            r = substrCount(727310, "");
            Console.WriteLine(r);

            r = substrCount(10, "aabbaaddee");
            Console.WriteLine(r);
        }
    }
}